import { useState } from "react/cjs/react.development";

function UserInput() {
  var name, mainPrices = [];
  var pricing = [];
  const [prices, setPrice] = useState();
  function onChangeHandler(event) {
    name = event.target.value;
  }
  function onClickHandler(event) {
    event.preventDefault();
      fetch('https://www.alphavantage.co/query?function=TIME_SERIES_DAILY_ADJUSTED&symbol=IBM&apikey=HIOOYZ15LELZLW0A').then(response => {
          return response.json();
      }).then((data) => {
       pricing = data['Time Series (Daily)'];
       for(const [key, value] of Object.entries(pricing)) {
         if(key == '1999-05-04') {
           console.log(key);
         }
       }
       
      });
  }
  return (
    <div>
      <form>
        <input className = "inputValue" type="text" placeholder="Enter city name" onChange = {onChangeHandler}></input>
        <button onClick = {onClickHandler} >
          Submit!
        </button>
        <h1>Celsius:{prices}</h1>
      </form>
    </div>
  );
}

export default UserInput;
